import React from 'react';
import { Wrapper, Form, Inputs, Input } from '../components/common';

const Home = () => {
  return (
    <Wrapper>
      <Form>
        <Input />
        <Input />
      </Form>
    </Wrapper>
  );
};

export default Home;
